import{_ as n,c as t,o as a,a5 as e}from"./chunks/framework.NAYRmF77.js";const m=JSON.parse('{"title":"Tải về và Cài đặt","description":"","frontmatter":{},"headers":[],"relativePath":"enjoy-app/install.md","filePath":"enjoy-app/install.md"}'),i={name:"enjoy-app/install.md"},h=e('<h1 id="tai-ve-va-cai-đat" tabindex="-1">Tải về và Cài đặt <a class="header-anchor" href="#tai-ve-va-cai-đat" aria-label="Permalink to &quot;Tải về và Cài đặt&quot;">​</a></h1><p>Enjoy App là một ứng dụng desktop đa nền tảng, có thể chạy trên các thiết bị máy tính như Windows, Mac và Linux.</p><p>Hãy tải về phiên bản phù hợp với hệ điều hành của máy tính bạn để cài đặt và sử dụng.</p><p>Phiên bản mới nhất hiện tại: <a href="https://github.com/zuodaotech/everyone-can-use-english/releases/latest" target="_blank" rel="noreferrer">v0.4.0</a></p><h2 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h2><p>Hỗ trợ các phiên bản Windows 10 trở lên.</p><p><a href="https://dl.enjoy.bot/app/win32/x64/Enjoy-0.4.0%20Setup.exe" target="_blank" rel="noreferrer">Nhấp để tải về</a></p><p>Sau khi tải về, nhấp đúp vào tệp để cài đặt.</p><div class="tip custom-block"><p class="custom-block-title">Làm gì nếu cài đặt trên Windows 10 báo lỗi?</p><p>Hệ điều hành Windows 10 có thể báo lỗi khi cài đặt:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>A JavaScript error occurred in the main process</span></span></code></pre></div><p>Điều này thường do thiếu một số phụ thuộc. Bạn có thể thử các bước sau để khắc phục:</p><ol><li>Cập nhật hệ điều hành lên phiên bản mới nhất;</li><li>Tải <a href="https://aka.ms/vs/17/release/vc_redist.x64.exe" target="_blank" rel="noreferrer">vs_redist.x64.exe</a> và cài đặt.</li></ol><p>Sau đó thử cài đặt lại Enjoy.</p></div><h2 id="mac" tabindex="-1">Mac <a class="header-anchor" href="#mac" aria-label="Permalink to &quot;Mac&quot;">​</a></h2><p>Tùy thuộc vào loại chip của máy Mac, bạn cần tải về phiên bản phù hợp.</p><ul><li><a href="https://dl.enjoy.bot/app/darwin/arm64/Enjoy-0.4.0-arm64.dmg" target="_blank" rel="noreferrer">Phiên bản Silicon (arm64)</a></li><li><a href="https://dl.enjoy.bot/app/darwin/x64/Enjoy-0.4.0-x64.dmg" target="_blank" rel="noreferrer">Phiên bản Intel (x64)</a></li></ul><div class="info custom-block"><p class="custom-block-title">Làm sao để kiểm tra cấu hình máy</p><p>Các máy Mac từ M1 trở đi (M1, M2, M3) đều sử dụng chip Silicon.</p><p>Nếu bạn không chắc chắn về mô hình máy của mình, hãy nhấp vào biểu tượng  ở góc trên bên trái màn hình, trong menu hiện ra, chọn tùy chọn đầu tiên “About This Mac”, trong cửa sổ hiện ra, bạn có thể xem cấu hình phần cứng và hệ thống của máy.</p><p>Nếu hiển thị là <em>Apple M Series</em>, thì máy của bạn sử dụng chip Silicon.</p></div><div class="warning custom-block"><p class="custom-block-title">Cảnh báo</p><p>Khuyến nghị sử dụng macOS 12 trở lên, macOS 11 có thể không hỗ trợ một số tính năng.</p></div><h2 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h2><p>Chọn tệp cài đặt phù hợp với bản phân phối của bạn.</p><ul><li><a href="https://dl.enjoy.bot/app/linux/x64/enjoy_0.4.0_amd64.deb" target="_blank" rel="noreferrer">Tải về phiên bản deb</a></li><li><a href="https://dl.enjoy.bot/app/linux/x64/Enjoy-linux-x64-0.4.0.zip" target="_blank" rel="noreferrer">Tải về phiên bản zip</a></li></ul><h2 id="phien-ban-lich-su" tabindex="-1">Phiên bản lịch sử <a class="header-anchor" href="#phien-ban-lich-su" aria-label="Permalink to &quot;Phiên bản lịch sử&quot;">​</a></h2><p>Tất cả các phiên bản lịch sử có thể tìm thấy <a href="https://github.com/zuodaotech/everyone-can-use-english/releases" target="_blank" rel="noreferrer">tại đây</a>.</p>',19),r=[h];function c(l,o,p,s,d,u){return a(),t("div",null,r)}const v=n(i,[["render",c]]);export{m as __pageData,v as default};
